import { BrowserRouter, Routes, Route, Link} from 'react-router-dom';
import React from 'react';
import Top from './components/Top';
import About from './components/About';
//import axios from 'axios';

function App() {

    return (
      <div>
        <BrowserRouter>
          <ul>
            <li>
            <Link to='/'>top</Link>
            </li>
            <li>
            <Link to='/about'>about</Link>
            </li>
          </ul>

          <Switch>
            <Route exact path='/'>
              <Top />
            </Route>
            <Route path='/about'>
              <About />
            </Route>
          </Switch>
        </BrowserRouter>

      </div>
    );
  }


export default App;
